// SeeAllUsers.js
import React, { useEffect, useState } from 'react';

const GetUsers = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Fetch the list of users from your backend and update the state.
  }, []);

  return (
    <div>
      <h2>See all Users</h2>
      <ul>
        {users.map((user) => (
          <li key={user.id}>{user.username}</li>
        ))}
      </ul>
    </div>
  );
};

export default GetUsers;
